class TaskA {
public:
	void solve(std::istream& in, std::ostream& out) {
		std::array<std::string, 10> arr = {{
				"ZERO",
				"ONE",
				"TWO",
				"THREE",
				"FOUR",
				"FIVE",
				"SIX",
				"SEVEN",
				"EIGHT",
				"NINE"
		}};
		vector<int> cnt(10);
		vector<int> letters(26);
		string s;
		in >> s;
		for (char c: s) {
			++letters[c - 'A'];
		}
		auto go = [&](char c, int ans) {
			cerr << int(c - 'A') << endl;
			cnt[ans] = letters[c - 'A'];
			for (char d: arr[ans]) {
				letters[d - 'A'] -= cnt[ans];
			}
		};
		go('Z', 0);
		go('W', 2);
		go('X', 6);
		go('G', 8);
		go('H', 3);
		go('R', 4);
		go('F', 5);
		go('V', 7);
		go('O', 1);
		go('I', 9);

		static int test = 0;
		out << "Case #" << ++test << ": ";
		for (int i: range(10)) {
			for (int j: range(cnt[i])) {
				out << i;
			}
		}
		out << "\n";
	}
};

#include <dirent.h>
#include <stdexcept>
#include <regex>
#include <sys/stat.h>
#include <cstdint>

std::string getLastFileName(const std::string& regexString) {
	DIR* dir;
	dirent* entry;
	std::string result = "";
	int64_t resultModificationTime = 0;
	std::regex regex(regexString);
	if ((dir = opendir (".")) != NULL) {
		while ((entry = readdir (dir)) != NULL) {
			if (std::regex_match(entry->d_name, regex)) {
				struct stat buffer;
				stat(entry->d_name, &buffer);
				int64_t modificationTime = static_cast<int64_t>(buffer.st_mtimespec.tv_sec) * 1000000000 +
						static_cast<int64_t>(buffer.st_mtimespec.tv_nsec);

				if (modificationTime > resultModificationTime) {
					resultModificationTime = modificationTime;
					result = entry->d_name;
				}
			}
		}
		closedir (dir);
	} else {
		throw std::runtime_error("Couldn't open current directory");
	}
	if (result.empty()) {
		throw std::runtime_error("No file found");
	}	return result;
}

